import React, { useState, useEffect } from "react";
import "./styles/newtrade.css";

const NewTrade = ({ onAdd }) => {
  const [showModal, setShowModal] = useState(false);
  const [formData, setFormData] = useState({
    symbol: "",
    optionType: "",
    strikePrice: "",
    expirationDate: "",
    entryPrice: "",
    exitPrice: "",
    contracts: "",
    openDate: "",
    closeDate: "",
    profitLoss: "",
  });

  useEffect(() => {
    // Any initialization code here
  }, []);

  const toggleModal = () => {
    setShowModal(!showModal);
  };

  const handleChange = (e) => {
    setFormData({ ...formData, [e.target.name]: e.target.value });
  };

  const handleSubmit = async (e) => {
    e.preventDefault();
    try {
      console.log("Submitting payload:", formData);

      // Make API request to add the new trade
      const response = await fetch("http://localhost:8000/trades/", {
        method: "POST",
        headers: {
          "Content-Type": "application/json",
        },
        body: JSON.stringify(formData),
      });

      if (!response.ok) {
        throw new Error("Failed to add trade");
      }

      const data = await response.json();
      onAdd(data);

      // Reset the form data
      setFormData({
        symbol: "",
        optionType: "",
        strikePrice: "",
        expirationDate: "",
        entryPrice: "",
        exitPrice: "",
        contracts: "",
        openDate: "",
        closeDate: "",
        profitLoss: "",
      });

      // Close the modal after successful submission
      setShowModal(false);
    } catch (error) {
      console.error("Error adding trade:", error);
    }
  };

  return (
    <div className="new-trade">
      <div className="header-card">
        <p>New</p>
      </div>
      {showModal && (
        <div className="modal">
          <div className="modal-content">
            <span className="close" onClick={() => setShowModal(false)}>
              &times;
            </span>
            <div className="card">
              <h1>Add New Trade</h1>
            </div>
            <form className="new-trade-form" onSubmit={handleSubmit}>
              <label htmlFor="symbol">Symbol:</label>
              <input
                type="text"
                name="symbol"
                value={formData.symbol}
                onChange={handleChange}
                required
              />
              <label htmlFor="optionType">Option Type:</label>
              <input
                type="text"
                name="optionType"
                value={formData.optionType}
                onChange={handleChange}
                required
              />
              <label htmlFor="strikePrice">Strike Price:</label>
              <input
                type="text"
                name="strikePrice"
                value={formData.strikePrice}
                onChange={handleChange}
                required
              />
              <label htmlFor="expirationDate">Expiration Date:</label>
              <input
                type="date"
                name="expirationDate"
                value={formData.expirationDate}
                onChange={handleChange}
                required
              />
              <label htmlFor="entryPrice">Entry Price:</label>
              <input
                type="text"
                name="entryPrice"
                value={formData.entryPrice}
                onChange={handleChange}
                required
              />
              <label htmlFor="exitPrice">Exit Price:</label>
              <input
                type="text"
                name="exitPrice"
                value={formData.exitPrice}
                onChange={handleChange}
              />
              <label htmlFor="contracts">Contracts:</label>
              <input
                type="text"
                name="contracts"
                value={formData.contracts}
                onChange={handleChange}
                required
              />
              <label htmlFor="openDate">Open Date:</label>
              <input
                type="date"
                name="openDate"
                value={formData.openDate}
                onChange={handleChange}
                required
              />
              <label htmlFor="closeDate">Close Date:</label>
              <input
                type="date"
                name="closeDate"
                value={formData.closeDate}
                onChange={handleChange}
              />
              <label htmlFor="profitLoss">Profit Loss:</label>
              <input
                type="text"
                name="profitLoss"
                value={formData.profitLoss}
                onChange={handleChange}
              />
              <input type="submit" value="Add" />
            </form>
          </div>
        </div>
      )}
    </div>
  );
};

export default NewTrade;
